import React from "react";
import './skills.css'

const frontendSkill = [
    {
        title: 'JavaScript',
        width: '85%',
        percentage: '85%'
    },
    {
        title: 'React.js',
        width: '85%',
        percentage: '85%'
    },
    {
        title: 'Redux',
        width: '15%',
        percentage: '15%'
    }
]

const Skills = () => {
    return <div className='skills__wrapper d-flex gap-5'>
        <div className="frontend__skill w-50">
            {
                frontendSkill.map((item, index) => (
                    <div className='skill__data mb-3'>
                        <div className="skill__title d-flex align-items-center justify-content-between">
                            <h6>{item.title}</h6>
                            <span>{item.percentage}</span>
                        </div>
                        <div className="skill__bar">
                            <div className="span skill__bar-percentage"></div>
                        </div>
                    </div>
                ))
            }
        </div>
        <div className='backend__skill'></div>
    </div>
}

export default Skills
